import './App.css';
import {Button,Grid} from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <Grid container>
        <Grid item md={6}>This is grid item 6</Grid>
        <Grid item md={6}>This is grid item 6</Grid>
      </Grid>
      <Button color="secondary" variant="contained">This is button , click me</Button>
    </div>
  );
}

export default App;
